import React from 'react';
import IndexButton from '../../components/assets/IndexButton';
import FlamingLips from '../../flamingLipsSampleImage.jpg';

export default class Home extends React.Component {
  constructor(props: any) {
    super(props);
  };

  render() {
    return (
      <div className="article-container">
        <div className="TopArea">
            <IndexButton/>
            <text className="breadcrumbs">Community <text className="caret-breaker"> > </text>Multinational</text>
        </div>
        <div className="TitleArea">
          <h1 className="article-title">A Collection of Songs Representing an Enthusiasm for Recording...By Amateurs</h1>
          <hr className="Title-LineBreak"/>
        </div>
        <div className="ImageArea">
          <img src={FlamingLips}/>
        </div>
      </div>
    );
  }
}
